import React from "react";
import { useNavigate } from "react-router-dom";
import { LogoutIcon } from "@heroicons/react/solid";
import HomeIcon from "../src/assets/home.svg"; // Ensure the path is correct
import HistoryIcon from "../src/assets/history.svg"; // Ensure the path is correct

const NavigationBar = ({ navbarVisible, toggleNavbarVisibility }) => {
  const navigate = useNavigate();

  return (
    <nav className={`bg-blue-900 text-white w-64 md:w-46 flex flex-col items-center p-5 space-y-6 h-screen justify-between absolute z-10 sm:z-0 sm:relative inset-y-0 left-0`} style={!navbarVisible ? { left: "-255px" } : {}}>
      {/* Rest of the nav content */}
      <div className="text-white flex flex-col items-center space-y-4 w-full">
        <button
          onClick={() => navigate('/')}
          className="hover:bg-slate-900 bg-opacity-60 text-white rounded p-2 flex items-center justify-center w-full md:w-45 gap-8"
        >
          <img src={HomeIcon} alt="home icon" className="backicadd-header rounded-sm" />
          <span>Home</span>
        </button>
        <button
          onClick={() => navigate('/history-table')}
          className="hover:bg-slate-900 bg-opacity-60 text-white rounded p-2 flex items-center justify-center w-full md:w-45 gap-7"
        >
          <img src={HistoryIcon} alt="history icon" className="backicadd-header" />
          <span>History</span>
        </button>
      </div>
      {/* Logout button */}
      <button className="mt-auto text-gray-300 hover:text-white flex items-center justify-center w-full">
        <LogoutIcon className="h-6 w-6" />
        <span className="hidden md:block">Log Out</span>
      </button>
    </nav>
  );
};

export default NavigationBar;
